import React from "react";
import "./App.css";
import logo from "./final-inkling-logo.png";
// import { Menu, MenuItem, MenuHeader } from "semantic-ui-react";
import About from "./About";
import Code from "./Code";
import Nav from "./NavBar";
// import { Navbar, Nav } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      {/* <h1>Inkling</h1> */}
      {/* <Menu compact fixed>
        <MenuItem>Inkling</MenuItem>
        <MenuItem>About</MenuItem>
        <MenuItem>Code Examples</MenuItem>
        <MenuItem>Learn More</MenuItem>
      </Menu> */}
      {/* <MenuExampleMenus></MenuExampleMenus> */}
      <Nav></Nav>
      <img className="logo" src={logo}></img>
      <About></About>
      <Code></Code>
    </div>
  );
}

export default App;
